import React, { Component } from 'react';


class NextButton extends Component {

    render() {
        return (
            <input type='submit' value='Add flashcard' style={addStyle}/>
        )
    }

}

const addStyle = {
    padding: '20px 30px',
    border: '2px dashed rgb(191, 191, 191)',
    background: 'white',
    cursor: 'pointer',
    margin: '30px',
};


export default NextButton;
